From the Back Cover
Tai Chi Chi Kung is a combination of movements and meditation techniques, which can help you calm yourself, relax or concentrate your physical strength and collect your spiritual strength to cope with a stressful or indeed, energetic situation.

Lucy Lloyd-Barker Dip.Acu., MRSS (T)&lt; PRSI (Med)T, presents this intriguing programme, explaining its history and guiding you through a complete Tai Chi Chi Kung can be practised anywhere with little or no equipment or assistance.
